import PropTypes from "prop-types";


const Button = ({text}) => {
    return <button
    style={{
        backgroundColor:"tomato",
        color:"white"
    }}
    >{text}</button>
}
export default Button;

Button.propTypes = {
    text: PropTypes.string.isRequired,
}
